/**
 * Created by tjung on 9/23/2017.
 */
public class MethodTest {

    public static void drawRect() {
        System.out.println("+------+");
        System.out.println("|      |");
        System.out.println("|      |");
        System.out.println("|      |");
        System.out.println("+------+");
    }

    public static void drawTriangle() {
        System.out.println("   *");
        System.out.println("  ***");
        System.out.println(" *****");
        System.out.println("*******");
    }

    public static void greeting(String name) {
        System.out.println("Hello " + name);
        System.out.println("Nice to meet you");
    }

    public static int findMax(int first, int second) {
        if (first > second){
            return first;
        }
        else {
            return second;
        }
    }

    public static int findSum(int x, int y){
        return x + y;
    }

    public static int findDiff(int x, int y){
        if ( x > y){
            return x - y;
        }
        else {
            return y - x;
        }
    }

    public static int findMult(int x, int y){
        return x * y;
    }

    public static int findFeet(int inches){
        return inches / 12;
    }

    public static void main(String[] args) {
        drawRect();
        drawRect();

        drawTriangle();
        greeting("Ryan");

        int max = findMax(5, 7);
        System.out.println(max);   // 7
//
        int sum = findSum(5, 7);
        System.out.println(sum); // 12
//
        int diff = findDiff(6, 10); // 4
        System.out.println(diff);

        int mult = findMult(6, 10);
        System.out.println(mult);  // 60

        // convert inches to feet
        // 26 inches -> 2 feet

        int numfeet = findFeet(26);
        System.out.println(numfeet);  // 2


    }
}

